import styled from 'styled-components';

export const Container = styled.div`
  position: relative;
  width: 980px;
  margin: 40px auto 9;
  z-index: 1;
`;

export const CrookedBG = styled.div`
  position: absolute;
  left: 0;
  height: 800px;
  width: 100%;
  background: #c4c4c4;
  transform: scale(1) rotate(-4deg) translateX(-1px) translateY(61px)
    skewX(-4deg) skewY(0deg);
`;
